  blueprint_courses_add_edit_associate_delete_bc26d5c2: "Blueprint-emne - legg til / endre / tilknytt / slett"
  blueprint_courses_are_an_account_level_feature_opt_3388f731: |-
      Blueprint-emne er eit funksjonsval på kontonivå.
      
      For å gjerne endringar i låseinnstillingane frå diskusjonssida, må 'Emne - legg til / endre / slett' og 'Diskusjonar - moderer' òg vere slått på.
  blueprint_courses_create_edit_associate_delete_bf41988e: "Blueprint-emne (opprett / rediger / tilknytt / slett)"
  blueprint_courses_is_an_account_level_feature_opti_38676924: "Blueprint-emne er eit funksjonsval på kontonivå. Emneroller kan kun administrere Blueprint-emne dersom dei er lagd til Blueprint-emnet som ein faglærar, undervisingsassistent eller designar. For å få tilgang til Blueprint-menyen, må 'Emne - legg til / rediger / slett emne' vere aktivert. For å legge til eit tilknytta emne, må 'Emne - vis liste' og 'Emne - legg til / rediger / slett' òg vere aktivert. For å redigere låseinnstillingar for alle Blueprint-objekt, må 'Emne - legg til / rediger / slett' vere aktivert. "
  blueprint_courses_is_an_account_level_feature_opti_3bf307d: "Blueprint-emne er eit funksjonsval på kontonivå. For å endre låseinnstillingar i diskusjonsoversikta for blueprintemne, må 'Emne - legg til / endre / slett' og 'Diskusjonar - vis' òg vere slått på. Dersom løyvet ikkje er slått på og 'Emne - legg til / endre / slett' og 'Diskusjonar - vis' er slått på, kan låseinnstillingane for blueprintemne endrast i enkeltståande diskusjonar. "
  blueprint_courses_is_an_account_level_feature_opti_4c9fa399: |-
      Blueprint-emne er eit funksjonsval på kontonivå.
      For å endre blueprint-låseinnstillingar i oppgåveoversikta, må 'Emne - legg til / endre / slett' òg vere slått på. Dersom dette løyvet ikkje er slått på, og 'Emne - legg til / endre / slett' er slått på, kan blueprint-låseinnstillingar for ei oppgåve administrerast i oppgåvedetaljar.
      For å endre blueprint-låseinnstillingar i ein individuell quiz eller på quizoversikta, må 'Emne - legg til / endre / slett' òg vere slått på.
  blueprint_courses_is_an_account_level_feature_opti_580ba84e: |-
      Blueprint-emne er eit funksjonsval på kontonivå.
      For å endre låseinnstillingar for Blueprint-emne på sideoversikta, må 'Emne - legg til  / endre / slett' òg vere slått på. Dersom løyvet ikkje er slått på, og 'Emne - legg til / endre / slett' er slått på, kan låseinnstillingar for Blueprint-emne endrast på einskilde sider.
  blueprint_courses_is_an_account_level_feature_opti_8429207: "Blueprint-emne er eit funksjonsval på kontonivå. For å endre innstillingar for Blueprint-emne i emneinnstillingar, må 'Blueprint-emne - legg til / endre / koble til / slett' òg vere slått på. For å legge til ei kobling til eit emne, må 'Blueprint-emne - legg til / endre / koble til / slett' og 'Emne - sjå liste' òg vere slått på. For å endre låseinnstillingar for eit kvart Blueprint-element, må dette løyvet vere slått på. For å endre låseinnstillingar for filer, må 'Emnefiler - legg til / endre / slett' òg vere slått på. For å endre låseinnstillingar for quizar, må 'Oppgåver og quizar - legg til / endre / slett' òg vere slått på. "
  blueprint_courses_is_an_account_level_feature_opti_a90144eb: |-
      Blueprint-emne er eit funksjonsval på kontonivå.
      
      For å legge til tilknytta emner, må 'Blueprint-emne - legg til / endre / slett' og 'Emne - legg til / endre / slett' óg vere slått på.
  blueprint_courses_must_be_enabled_for_an_account_b_188041e1: |-
      Blueprint-emne må vere aktivert på kontonivå av ein administrator.
      For å endre låseinnstillingane for filer i blueprint-emne må 'Emne - legg til / endre / slett' òg vere slått på.
  blueprint_courses_must_be_enabled_for_an_account_b_25a8af6a: |-
      Blueprint-emne må aktiverast på kontonivå av ein administrator.
      Emneroller kan kun administrere innhald i Blueprint-emne dersom dei er lagde til eit Blueprint-emne som faglærar, undervisingsassistent eller designar.
  blueprint_courses_must_be_enabled_for_an_account_b_45d8df0c: |-
      Blueprintemne for konto må vere slått på av ein admin.
      
      Emnemedlem kan berre administrere innhald i Blueprintemne dersom dei er lagt til Blueprintemnet med rolla faglærar, undervisingsassistent eller designar.
      
      For å endre låseinnstilling på eit Blueprintemne frå diskusjonsoversikta, må 'Diskusjonar - administrer' òg vere slått på.
  blueprint_courses_must_be_enabled_for_an_account_b_5ab5b804: "Blueprint-emne må vere aktivert på kontonivå av ein admin. Emneroller kan kun administrere innhald i Blueprint-emne dersom dei er lagde til Blueprint-emnet som ein faglærar, undervisingsassistent eller designar. Ein brukar kan framleis justere låseinnstillinger for innhald på individuelle sider i eit Blueprint-masteremne, sjølv om løyvet er slått av. "
  blueprint_courses_must_be_enabled_for_an_account_b_79b2d93e: |-
