  blueprint_courses_must_be_enabled_for_an_account_b_a8e326ea: |-
      Blueprint-emne må vere aktivert på kontonivå av ein administrator.
      For å endre låseinnstillingane for filer i blueprint-emne må 'Emne - legg til / endre / slett' òg vere slått på.
