      links: 
        create: "Opprett e-portefølje"
      page_title: "Mine e-porteføljer"
      what: 
        details1: |-
            I e-portefølje kan du vise fram og diskutere viktige
            innleveringar og erfaringar under
            læreprosessen. Du kan bruke e-porteføljer til å:
            
            * vise fram skriftlege prøver du er stolt av slik at fleire enn faglærar kan sjå
            * snakke om alle tankane og alt arbeidet du har lagt ned i innleveringane dine
            * lage ei oversikt over den totale utdanningserfaringa
            * dele arbeidet ditt med venner, moglege arbeidsgjevarar osv.
            
            e-porteføljen kan vere offentleg og synleg for alle, eller privat slik at berre dei du
            vil har innsyn. Du kan endre innstillingane når du vil.
            
            Vil du kome i gang? Klikk på knappen.
    wizard_box: 
      finish: 
        body: "Vil du kome i gang? Du kan alltid gå tilbake til denne vegvisaren, frå alle sidene, ved å klikke på lenka \"%{help_link_text}\" her."
      headers: 
        finish: "Sett i gang"
        getting_started: "Kome i gang"
        instructions: "Bruke e-portefølje"
        introduction: Introduksjon
        page_content: Sideinnhald
        pages: Seksjonssider
        sections: Porteføljeseksjonar
        settings: Porteføljeinnstillingar
        submissions: "Legg til innleveringar"
      introduction: 
        body: "i e-porteføljen kan du vise fram arbeidet ditt. Porteføljen er delt inn i område og sider. Du finn lista over område på venstre side i vindauget (%{showme1}). Kvart område inneheld fleire sider som du ser på høgre side i vindauget (%{showme2})."
      links: 
        portfolio: "Sjå porteføljen"
      page_content: 
        body1: "Innhaldet du ser på ei side er same innhaldet som alle gjestar kan sjå. Dersom du vil redigere innhaldet, klikkar du på \"%{edit_link_text}\"-lenka (%{showme}) og sida går i redigeringsmodus."
        body2: "Du redigerer. Endre sidenamnet, eller endre kommentaralternativa (%{showme1}) om du vil det. Du kan lagre, førehandsvise eller avbryte endringane når som helst, ved å klikke på knappen på høgre side (%{showme2})."
        body3: "Innhaldet er delt inn i avsnitt som har ei prikka linje. Du kan slette eller redigere innhaldet i eit avsnitt ved å klikke på ikona %{edit_icon} eller %{delete_icon} øvst i høgre hjørne på avsnittet."
        body4: "Dersom du vil legge til nye avsnitt, klikkar du på type innhald du vil legge til i vallista på høgre side i vindauget (%{showme})."
      pages: 
        body1: "Seksjonane har fleire sider. Du kan sjå lista over sider for gjeldande seksjonar på høgre side i vindauget (%{showme1}). Dersom du vil organisere eller legge til sider, klikkar du på \"%{manage_pages}\"-lenka (%{showme2})."
        body2: "Du kan endre sidenamna ved å klikke på %{edit_icon}-ikonet, slette ei side ved å klikke på %{delete_icon}-ikonet eller omorganisere rekkefølgje på sidene ved å klikke på og dra dei."
      sections: 
        body1: "Du finn lista over område på venstre side i vindauget (%{showme1}). Kvart område inneheld fleire sider. Dersom du vil organisere eller legge til område, klikkar du på \"%{manage_sections}\"-lenka (%{showme2})."
        body2: "Du kan endre alle seksjonsnamn ved å klikke på %{edit_icon}-ikonet, omorganisere seksjonar ved å klikke på og dra dei eller slette seksjonar ved å klikke på %{delete_icon}-ikonet."
      settings: 
        body: "Dersom du vil endre innstillingane for e-porteføljen, klikkar du på \"Porteføljeinnstillingar\"-lenka (%{showme}). Du kan endre namnet på porteføljen og veksle mellom offentleg og privat. Private porteføljer er berre synlege for dei du gir tilgang."
      submissions: 
        body1: "Som du kanskje har lagt merke til finn du nedst på denne sida ei liste over dei siste innleveringane frå seksjonane dine (%{showme}). Du kan enkelt legge innleveringar frå denne sida til i nye sider i porteføljen din. Det er berre å klikke på innleveringa du vil legge til og eit popup-vindauge kjem til syne."
        body2: "Flott. Dersom du skal fullføre innleveringa, må du velje klassa du vill legge innleveringa til og endre sidenamnet. Etter at du har klikka på \"Legg til side\" går du til ei ny side der det er mogleg å redigere detaljar."
