    course_already_started: 
      email: 
        body: |-
            Hei %{user},
            
            %{course}, emnet ditt i Canvas Network starta opp for eit par dagar sidan og vi ser at du ikkje har logga på enno. Dette er ei siste påminning i tilfelle du har gløymt å logge deg på.
            
            Om du vil logge på, gå til %{site} og oppgi brukarnamn og passord. Om du ikkje har laga eit passord enno, kan du gjere det her: %{password_url}
            
            Dersom du ikkje har høve til å gjennomføre dette emnet, kan du bla gjennom emnekatalogen på %{site} og finne eit anna emne som engasjerer deg. Vi legg til nye emne kontinuerleg!
            
            
            Vi håper å sjå deg snart,
            
            Canvas Network
        course_already_started: "Emnet ditt har allereie starta"
