      email: 
        body: |-
            Hei %{user},
            
            Godt nytt! %{course}, emnet du har meldt deg på i Canvas Network, startar snart.
            
            Dersom du vil få mest mogleg ut av emnet, bør du sjekke om faglærar har lagt ut ekstra instruksjonar eller materiale. Du kan sjå etter dette på sida for emnedetaljar i Canvas Network, eller klikke på lenka nedanfor.
            
            %{url}
            
            Hald fram med å lære,
            
            Canvas Network
        course_required_materials: "Materiale og instruksjonar for %{course}"
    course_started: 
      email: 
        body: |-
            Hei %{user},
            
            Dette er ei påmining om at %{course}, emnet ditt i Canvas Network, startar i dag. Du kan logge på %{site} og starte no.
            
            Hugs å opprette Canvas Network-profil slik at andre i emnet får vite kven du er. Du kan oppdatere profilen på %{profile_url}
            
            Hald fram med å lære,
            
            Canvas Network
        course_starts_today: "Emnet ditt startar i dag"
    course_starts_in_week: 
      email: 
        body: |-
            %{user},
            
            Snart oppstart! %{course}, emnet du har meldt deg på i Canvas Network, startar neste veke. Vi veit at du gler deg, det gjer vi også.
            
            Kva kan du gjere for å førebu deg?
            
            Om du ikkje allereie har oppretta Canvas Network-profil, kan du logge på og opprette ein på Canvas.net. Profilen din hjelper andre på emnet til å finne ut kven du er. Du kan også legge inn varslingspreferansar.
            
