      Denne funksjonen gjeld institusjonar som har ein eksisterande SIS-Canvas-integrasjon.
      Kundar som bruker eksterne løysingar med tilbakeføring av vurderingsresultat til Canvas
      bør slå på denne funksjonen for å forbetre arbeidsflyten for validering av oppgåvedata.
