    grade_export: 
      description: "Vurderingseksport for SIS"
      name: Vurderingseksport
    grade_export_settings: 
      description: |-
          Dette programtillegget gjer at sluttvurdering kan overførast til eit studentinformasjonssystem (SIS). Når det er slått på får brukaren eit val i vurderingsoversikta om å publisere vurderingen. Det vil skje ved eit POST-kall til eit spesifisert publiseringssluttpunkt. Kvar type definerer sitt eige innhaldsformat og mime-type. Responsen frå sluttpunktet er uvesentlig og kan ignorerast.
          
          Eit eksempel: den Instructure-formaterte CSV-fila vil POSTe ein csv-fil med mime-type 'text/csv' til det spesifiserte sluttpunktet med følgande kolonnar:
          
          "publisher_id", "publisher_sis_id", "course_id", "course_sis_id", "section_id", "section_sis_id", "student_id", "student_sis_id", "enrollment_id", "enrollment_status", "score", "grade"
          
          (Merk: kolonnen "grade" returnerer berre innhald dersom eit emne har spesifisert ein vurderingsstandard)
          
          For kvar student i emnet som skal overførast blir det produsert 1 eller fleire rader i csv-fila. Meir spesifikt blir det oppretta 1 rad for kvar innlogging studenten gjer til emnet sin rotkonto. Dei fleste gongane resulterer det i 1 rad per student, men dersom studenten har fleire innloggingar, blir det ein rad for kvar innlogging.
          
          Dersom "Inkluder overstyring av sluttvurdering" er haka av og funksjonsvalet for Overstyr sluttvurdering er slått på, vil studentar med overstyrt vurderingsresultat få dette resultatet overført istadenfor det utrekna resultatet.
      labels: 
        format_type: "Type utdataformat"
        include_final_grade_overrides: "Inkluder overstyringar av sluttvurdering"
        publish_endpoint: "Endepunkt å publisere til"
        success_timeout: "Varsel tidsavbrot (i sekund)"
        wait_for_success: "Vent på positivt varsel"
