  this_report_gets_a_count_of_submissions_that_were__207a3d59: |-
      Denne rapporten får eit antal på kor mange innleveringar som vart levert på ein gitt dag.
      Antal innleveringar kan endre seg over tid, sidan dette sjekker submitted_at attributten i databasen.
