  this_report_provides_all_active_eportfolios_for_th_f7432621: "Denne rapporten vil inkludere alle aktive ePortfoliar for heile institusjonen. Alternativt kan ein velje \"kun ePortfolioar fra brukarar utan medlemskap\" for å redusere omfanget av ePortfolioar til dei brukarane som ikkje har medlemskap. Du kan også kjøyre rapporten med \"inkluder sletta objekt\" for å få eit utplukk med dei som har blitt sletta."
  this_report_shows_all_learning_outcomes_that_exist_e77bd04b: "Rapporten viser alle læringsmål som er oppretta innanfor kontoen. CSV-fila inneheld ei rad per læringsmål og viser alle  eigenskaper som høyrer til kvart læringsmål."
  this_report_shows_all_the_activity_from_users_enro_46394fa6: "Denne rapporten viser all aktivitet for alle personar i eit gitt emne eller alle emne i eit gitt semester. CSV-fila vil ha ei rekkje per student-aktivtet, og vil ha desse overskriftene: påmeldingstype, seksjon-id, seksjon-sis-id, seksjons-namnet, emne-id, emne-sis-id, emnenamn, brukar-id, brukar-sis-id, innhaldstype, innhald, antal ganger vist, antal ganger deltatt, sist vist. Antal ganger vist og antal ganger deltatt er frå tidenes morgen til då rapporten vart laga."
  this_report_shows_all_the_activity_from_users_enro_8f8e0ca1: |-
      Denne rapporten viser all aktivitet for personar i alle emne
      i eit gitt semester. CSV-fila vil ha ei rekkje per student-aktivtet,
      og vil ha desse overskriftene: seksjon-id, seksjon-sis-id,
      seksjons-namnet, emne-id, emne-sis-id, emnenamn, semester-id, semester-sis-id,
      semesternamn, brukar-id, brukar-sis-id, brukarnamn, innhaldstype, innhald, antal ganger vist,
      antal ganger deltatt, sist vist. Antal ganger vist og antal ganger deltatt er
      frå tidenes morgen til då rapporten vart laga.
      Maks ein måned med data vil bli henta. Standard er satt til å hente
      data frå byrjinga av førre veke.
  this_report_shows_all_the_courses_for_a_given_term_3cdc11e5: "Rapporten viser alle emna for eit bestemt semester. Den endelege CSV-fila inneheld ei rad per emne og viser emne-ID-en, emne-SIS-ID-en, emnet sitt kortnamn, emnenamnet, konto-ID, konto-SIS-ID, kontonamn, brukt lagringskapasitet i MB og summen av alle filene i MB. Brukt lagringskapasitet  måler total bruk av emnekvoten. Summen av alle filene i emnet tar ikkje omsyn til storleiken på emnekvoten."
  this_report_shows_all_the_courses_for_a_given_term_9102a3d7: "Rapporten viser alle kursa for eit bestemt semester. Den endelege CSV-fila inneheld ei rad per kurs og viser kurs-ID-en, kurs-SIS-ID-en, kurset sitt kortnamn, kursnamnet, konto-ID, konto-SIS-ID, kontonamn og lagringskapasitet brukt i MB."
  this_report_shows_grading_period_grades_and_overal_a86346a: "Rapporten viser alle vurderingsperiodane (og alle vurderingar) for kvar student som er påmeldt i eit bestemt semester. Den endelege csv-fila inneheld ei rad per brukarpåmelding."
  this_report_shows_the_student_final_grade_results__5a508b55: "Rapporten viser alle studentane sine sluttvurderingar i eit bestemt semester. CSV-fila inneheld ei rad per påmelding og viser gjeldande og endelege vurderingar som er lagt ut vurderingsoversikta for emnet."
  this_sample_page_includes_common_ui_elements_in_ca_331f4ac4: "Eksempelsida inneheld vanlege UI-element i Canvas, som kan hjelpe deg med å lage din eigen utsjånad. Når du gjer endringar i fargeverdiar og bilde i venstre sidestolpe, ser du knappen *Førehandsvis endringane*. Klikk på knappen for å oppdatere sida og sjå på endringane."
  this_sample_page_includes_common_ui_elements_in_ca_ef71449d: "Denne eksempelsida inneheld vanlege UI-element i Canvas, som kan hjelpe deg med å lage din eigen utsjånad. Når du gjer endringar i fargeverdiar og bilde, ser du knappen *Førehandsvis endringane*. Klikk på knappen for å oppdatere sida og sjå på endringane."
  this_setting_only_affects_your_view_of_student_gra_8f58eb33: "Denne innstillinga påvirkar berre korleis du ser studentvurderingar, og visar vurderingane som om alle ikkje-vurderte oppgåver blei gitt resultatet null. Denne innstillinga er berre ei framvisningn og påvirkar ikkje vurderingsresultatet for studentane eller andre brukarar av vurderingsoversikta. Når denne innstillinga er slått på vil Canvas ikkje sette inn null i Vurderingsoversikta for studentinnleveringar i individuelle oppgåver. Berre oppgåvegrupper og total-kolonner vil automatisk ta med null-resultat i den gjenomsnittlege prosentandelen for kvar student. "
