  to_allow_full_management_of_conferences_created_by_902e96e4: |-
      For å sikre full administratortilgang til konferansar oppretta av brukaren sjølve eller andre, må 'Emneinnhald - legg til / endre / slett' òg vere aktivert.
      For å avslutte ein lengevarande konferanse, må 'Emneinnhald - legg til / endre / slett' vere slått på.
      Brukarar kan framleis administrere konferansar, sjølv om 'Emneinnhald - legg til / endre / slett' er slått på og 'Webkonferansar - opprett' er slått av.
      Løyvet sikrar at ein brukar kan opprette konferansar i emne og grupper.
  to_allow_full_management_of_conferences_created_by_bc7910e6: "For å tillate administrasjon av konferansar oppretta av brukaren eller andre må løyve for emneinnhald vere slått på"
