      For å gi full løyve til å administrere konferansar oppretta av ein brukar, må 'Emneinnhald - legg til / endre / slette' òg vere slått på.
      For å ende ein konferanse må 'Emneinnhald - legg til / endre / slett' vere slått på.
      Dersom 'Emneinnhald - legg til / endre / slett' er slått på og 'Nettkonferansar - opprett' er slått av, kan brukaren framleis administrere konferansar.
      Løyvet styrer korleis ein brukar kan opprette konferansar i emne og grupper.
